Array.prototype.max=function(){for(var t=this[0],i=this.length,n=1;n<i;n++)this[n]>t&&(t=this[n]);return t},Array.prototype.min=function(){for(var t=this[0],i=this.length,n=1;n<i;n++)this[n]<t&&(t=this[n]);return t},String.prototype.ReplaceAll=function(n,t){for(var i=this,r=i.indexOf(n);r!=-1;)i=i.replace(n,t),r=i.indexOf(n);return i},Date.prototype.addHours=function(n){return this.setHours(this.getHours()+n),this},String.prototype.trim=function(){return this.replace(/^\s+|\s+$/g,"")},String.prototype.ltrim=function(){return this.replace(/^\s+/,"")},String.prototype.rtrim=function(){return this.replace(/\s+$/,"")},String.prototype.startsWith=function(n){return this.slice(0,n.length)==n}